import React from 'react';
import Tabs from "./components/tabs/Tabs";
import "./App.css";

function App() {
  return (
    <div className="main-container">
      <div class="center-container">
        <Tabs>
          <div label="Home Page" >
            <div >
              <em>Home page</em>!
            </div>
          </div>
          <div label="About Us">
            <em>About us</em>!
        </div>
          <div label="Contact Us">
            <em>Contact us</em>!
        </div>
        </Tabs>
        <p>Login </p>
        <p> / </p>
        <p> Sign up</p>
      </div>
    </div>
  );
}

export default App;
